import Navbar from './Navbar';
import About from './pages/About';
import Cart from './pages/Cart';

function App() {
  let Component

  // eslint-disable-next-line default-case
  switch(window.location.pathname){
    case "/": 
      Component = App
      break
    case "/about":
     Component = About
      break
    case "/cart":
      Component = Cart
      break
  }
  return (
  <>
     <Navbar />
     <Component />
  </>
)

}

export default App;
